version = 1
requires-python = ">=3.10, <4"
resolution-markers = [
    "python_full_version < '3.11' and platform_python_implementation == 'CPython'",
    "platform_python_implementation != 'CPython'",
    "python_full_version >= '3.11' and platform_python_implementation == 'CPython'",
]

[manifest]
members = [
    "hop3",
    "hop3-agent",
    "hop3-cli",
    "hop3-lib",
    "hop3-server",
    "hop3-web",
]

